Een groep Irak-veteranen is op de vlucht voor het Amerikaanse leger. Deze groep, die bekend staat als 'The A-Team', probeert zo 
snel mogelijk hun naam te zuiveren, omdat ze ten onrechte te boek staan als gevaarlijke criminelen. Ze worden beschuldigd van 
een ernstige misdaad die ze niet begaan hebben.
